import Square from './Square'

const Board = ({squares, blueTurn, onAdd}) => {
	
	return(
		<div className = 'boardContainer'>
			{squares.map((square) => (
			<Square square = {square} blueTurn = {blueTurn} onAdd = {onAdd} />
			))}
		</div>
	)
}


export default Board
